  created() {
    this.url = `${this.$store.getters.getServerUrl}api/v1/cabinet/${this.$store.state.cuser.slug}?limit=10&search=`, this.loadListPosts(this.url);
  },
  methods: {
    async loadListPosts(url) {
      axios({
        url: url,
        method: 'GET',
        headers: {
          'Content-type': 'application/json'
        }
      }).then(response => {
        this.listPosts = response.data.results, this.total = response.data.count, this.prev = response.data.previous, this.next = response.data.next;
      });
      console.log(this.listPosts);
    },
    goTo(slug) {
      this.$router.push({
        name: 'panel_change',
        params: {
          slug: slug
        }
      });
    },
    delete_p(slug_p) {
      axios({
        url: this.$store.state.backendUrl + `api/v1/delete/${slug_p}`,
        method: 'DELETE'
      }).then(resp => {
        console.log(resp);
      }).then(() => this.$router.go());
    }
  }
};
